BEGIN TRANSACTION;
CREATE TABLE "DBProject_allenatore" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "utente_id" bigint NOT NULL UNIQUE REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "squadra_id" bigint NULL REFERENCES "DBProject_squadra" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_atleta" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stato" varchar(15) NOT NULL, "utente_id" bigint NOT NULL UNIQUE REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "squadra_id" bigint NULL REFERENCES "DBProject_squadra" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_comunicazioneufficiale" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "titolo" varchar(200) NOT NULL, "contenuto" text NOT NULL, "data_invio" datetime NOT NULL, "presidente_regione_id" bigint NOT NULL REFERENCES "DBProject_presidenteregione" ("utente_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_gara" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "luogo" varchar(200) NOT NULL, "data_inizio" date NOT NULL, "presidente_regione_id" bigint NOT NULL REFERENCES "DBProject_presidenteregione" ("utente_id") DEFERRABLE INITIALLY DEFERRED, "data_fine" date NULL);
CREATE TABLE "DBProject_garaspecialita" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sesso" varchar(1) NOT NULL, "id_gara_id" bigint NOT NULL REFERENCES "DBProject_gara" ("id") DEFERRABLE INITIALLY DEFERRED, "id_specialita_id" bigint NOT NULL REFERENCES "DBProject_specialita" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_partecipazione" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "id_atleta_id" bigint NOT NULL REFERENCES "DBProject_atleta" ("id") DEFERRABLE INITIALLY DEFERRED, "id_gara_id" bigint NOT NULL REFERENCES "DBProject_gara" ("id") DEFERRABLE INITIALLY DEFERRED, "id_specialita_id" bigint NOT NULL REFERENCES "DBProject_specialita" ("id") DEFERRABLE INITIALLY DEFERRED, "stato_iscrizione" varchar(20) NOT NULL, "risultato" varchar(100) NULL);
CREATE TABLE "DBProject_presidenteregione" ("utente_id" bigint NOT NULL PRIMARY KEY REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "regione_id" bigint NOT NULL UNIQUE REFERENCES "DBProject_regione" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_presidentesquadra" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "utente_id" bigint NOT NULL UNIQUE REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "squadra_id" bigint NULL UNIQUE REFERENCES "DBProject_squadra" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_regione" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(100) NOT NULL UNIQUE);
CREATE TABLE "DBProject_specialita" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(100) NOT NULL UNIQUE);
CREATE TABLE "DBProject_squadra" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(100) NOT NULL UNIQUE);
CREATE TABLE "DBProject_utente" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "tipo" varchar(20) NOT NULL, "email" varchar(254) NULL UNIQUE);
CREATE TABLE "DBProject_utente_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "utente_id" bigint NOT NULL REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "DBProject_utente_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "utente_id" bigint NOT NULL REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "DBProject_utente" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
